    var e=[];
    var tabCount;
    if(production) {
        tabCount = 0;
    } else {
        if(debug) {
            tabCount = 0;
        } else {
            if(compLen>=5 && compLen<=10) {
                tabCount=4;
            } else if(compLen>10) {
                tabCount=9;
            } else {
                tabCount= compLen-1;
            }
        } 
    }    
    function openTabs() {       
        for(var i=0;i < tabCount;i++){          
            e = document.createElement("a");
            e.id="new";
            e.href= "http://localhost:"+port+"/"+i;
            e.target="_blank";
            e.rel = "noreferrer";    
            e.click();                       
        }
    }
